INSERT INTO `mix_acticle` VALUES ('20', '24', 'C#开启路由器upnp功能 ', '原创', '2016-01-14 00:08:49', '条件：路由器需要支持upnp功能，并且要处于打开状态。0x01 引用using NATUPNPLib;                //Windows UPnP COM组件10x02 功能        private Boolean OpenUPnp(){            IStaticPortMappingCollection mappings = _uPnPNAT.StaticPortMappingCollection;            if (mappings == null){                    Console.WriteLine(\"没有检测到路由器，或者路由器不支持UPnP功能\");                    return false;           }           mappings.Add([int外部端口], \"TCP\", [int内部端口], [string内网ip], true, description);            return true;        }之后只需要端口和外网ip就可以进行socket连接了。有些家用网络包含两层NAT或更多，这种方法便不可行。', '20.html');
INSERT INTO `mix_acticle` VALUES ('21', '24', 'C#中各种异步操作的方法', '原创', '2016-01-14 00:12:18', '0x01      无参数，无返回值的异步方法：static void Main(){    new Thread(DoSomething).Start();}public void DoSomething(){...}0x02      有参数，无返回值的异步方法：//使用Threading//在这里要异步执行的函数的参数arg只能是Object类型，而且参数只能有一个。//如果想用这种方法传多个参数，可以将参数添加到List<Object>，转换为Object传入函数中。static void Main(){    var asy = new Thread(new ParameterizedThreadStart(DoSomething1));    asy.Start(arg); }//使用匿名委托方法new Thread(delegate(){    DoSomething2(\"arg1\", \"arg2\", \"arg3\");}).Start();//Lambada也是很好用的new Thread(() =>{    DoSomething2(\"arg1\",\"arg2\",\"arg3\");}).Start();//使用Task.RunTask.Run(() =>{    DoSomething2(\"arg1\", \"arg2\", \"arg3\");});public static ', '21.html');
