INSERT INTO `mix_acticle` VALUES ('26', '0', 'VB.net学习笔记之发送邮件：System.Net.Mail', '原创', '2016-01-14 01:15:25', '学习了VB.net如何发送邮件的方法，为了防止忘记，记下来~[vb] view plaincopyprint?    Imports System.Net.Mail      Imports System.IO        Private Sub Button2_Click(ByVal sender As System.Object, ByVal e As System.EventArgs) Handles Button2.Click                  SenderName = TextBox5.Text          SenderSMTP = TextBox6.Text    \'需要使用的SMTP服务器          SenderPW = TextBox7.Text      \'发送邮件的邮箱的密码          Senders = SenderName & \"@\" & SenderSMTP & ComboBox1.Text   \'完整的邮箱地址比如example@126.com          Reciver = TextBox1.Text       \'接收者邮箱          SubTitle = TextBox2.Text      \'邮件标题          Acticle = TextBox3.Text       \'邮件正文  ', '26.html');
INSERT INTO `mix_acticle` VALUES ('27', '23', 'CubieTruck Debian打开WIFI方法', '原创', '2016-01-14 01:16:27', '最近新入手了一块CubieTruck的板子，激动啊~但是原装Android实在是让我蛋疼不少...果断官网下载Debian，我使用的是有可视化界面的，直接写入固件中，而不是TF卡的版本，下载地址：debian-chird-desktop-nand.img.gz，我用的学校实验室的网，速度还可以，具体怎么烧录我就不多说了，网上教程满天飞...安装完成后第一件事就是让无线网能正常使用：1.加载模块:[plain] view plaincopyprint?sudo modprobe bcmdhd  2.安装wicd 无线网管理器:[plain] view plaincopyprint?sudo apt-get install wicd  有\n人说为啥不用自带的network-manager呢？我只想说，自带的那个nm实在是太烂了，如果一定要使用的话，不仅要改它的配置文件，再改/etc\n/network/interfaces，而且还十分不稳定~所以我果断放弃之。之后wicd和network-manager并不冲突，非处女座可无视\n之...3.连接网络:直接右下角→互联网→Wicd Network Manager→首选项→常规设置→无线网络，在里面填入wlan1，这个地方因板子而异，我的是wlan1，查看方法是在LX终端输入ifconfig，其中带wlan的就是你的网线网卡端口。填到里面就行', '27.html');
INSERT INTO `mix_acticle` VALUES ('28', '23', 'CubieTruck Debian搭建nodejs环境 ', '原创', '2016-01-14 01:17:09', '入手了CubieTruck，下一步就是要搭建一个nodejs环境，折腾了好几天，终于弄出来了，给大家分享一下搭建过程吧~1.安装编译需要的环境：[plain] view plaincopyprint?sudo apt-get install python g++ make checkinstall  2.从官网上获取源代码并解压：[plain] view plaincopyprint?mkdir ~/src  cd ~/src  wget -N http://nodejs.org/dist/node-latest.tar.gz  tar xzvf node-latest.tar.gz && cd node-v*  3. 配置编译源代码[plain] view plaincopyprint?./configure --without-snapshot //注意这个地方一定要加入这个参数，否则之后在运行时有可能会出现段错                                //误的提示。  sudo checkinstall  4.安装和卸载[plain] view plaincopyprint?sudo dpkg -i node_*  sudo dpkg -r node  5.检测是否正常工作在TX终端中输入node，再输入：[plain] view plaincopypr', '28.html');
INSERT INTO `mix_acticle` VALUES ('30', '27', 'T-SQL经典语句', 'imdbt.blog.51cto.com', '2016-01-15 09:30:45', '一、基础1、说明：创建数据库CREATE DATABASE database-name 2、说明：删除数据库drop database dbname3、说明：备份sql server--- 创建 备份数据的 deviceUSE masterEXEC sp_addumpdevice \'disk\', \'testBack\', \'c:mssql7backupMyNwind_1.dat\'--- 开始 备份BACKUP DATABASE pubs TO testBack 4、说明：创建新表create table tabname(col1 type1 [not null] [primary key],col2 type2 [not null],..)根据已有的表创建新表： A：create table tab_new like tab_old (使用旧表创建新表)B：create table tab_new as select col1,col2… from tab_old definition only5、说明：删除新表drop table tabname 6、说明：增加一个列Alter table tabname add column col type注：列增加后将不能删除。DB2中列加上后数据类型也不能改变，唯一能改变的是增加varchar类型的长度。7、说明：添加主键： Alter', '30.html');
INSERT INTO `mix_acticle` VALUES ('31', '27', 'SQL Server 存储过程', 'cnblogs.com', '2016-01-15 10:28:06', 'Transact-SQL中的存储过程，非常类似于Java语言中的方法，它可以重复调用。当存储过程执行一次后，可以将语句缓存中，这样下次执行的时候直接使用缓存中的语句。这样就可以提高存储过程的性能。Ø 存储过程的概念    存储过程Procedure是一组为了完成特定功能的SQL语句集合，经编译后存储在数据库中，用户通过指定存储过程的名称并给出参数来执行。    存储过程中可以包含逻辑控制语句和数据操纵语句，它可以接受参数、输出参数、返回单个或多个结果集以及返回值。    由于存储过程在创建时即在数据库服务器上进行了编译并存储在数据库中，所以存储过程运行要比单个的SQL语句块要快。同时由于在调用时只需用提供存储过程名和必要的参数信息，所以在一定程度上也可以减少网络流量、简单网络负担。     1、 存储过程的优点        A、 存储过程允许标准组件式编程        存储过程创建后可以在程序中被多次调用执行，而不必重新编写该存储过程的SQL语句。而且数据库专业人员可以随时对存储过程进行修改，但对应用程序源代码却毫无影响，从而极大的提高了程序的可移植性。        B、 存储过程能够实现较快的执行速度        如果某一操作包含大量的T-SQL语句代码，分别被多次执行，那么存储过程要比批处理的执行速度快得多。因为存储过程是预编译的，在首次运行一个存储过程时，查询优化器对', '31.html');
INSERT INTO `mix_acticle` VALUES ('32', '28', 'Global.asax使用方法', 'blog.csdn.net', '2016-01-15 10:35:56', '　　用JAVA开发WEB项目时，在处理特殊的HTTP请求，或全局处理一些页面代码时会用到监听器、过滤器，接触到ASP.NET开发WEB项目�时，监听器、过滤器的概念不像JAVA那样清晰，但看到Global.asax　时，才明白ASP.NET原来有这么一个处理全局代码的安排，用过�Global.asax　后，个人理解可以在Global.asax　中处理过滤和监听这样的功能。觉得Global.asax　在开发和维护项目的健壮性和安全性又多了一个选择，以下是我转载的一篇很好的关于Global.asax　的文章。  　　Global.asax 文件，有时候叫做 ASP.NET 应用程序文件，提供了一种在一个中心位置响应应用程序级或模块级事件的方法。你可以使用这个文件实现应用程序安全性以及其它一些任务。下面让我们详细看一下如何在应用程序开发工作中使用这个文件。 　　概述 　�　Global.asax 位于应用程序根目录下。虽然 Visual Studio .NET 会自动插入这个文件到所有的 ASP.NET �项目中，但是它实际上是一个可选文件。删除它不会出问题——当然是在你没有使用它的情况下。.asax �文件扩展名指出它是一个应用程序文件，而不是一个使用 aspx 的 ASP.NET 文件。 　　Global.asax �文件被配置为任何（通过 URL 的）直接 HTTP 请求都被自动拒', '32.html');
INSERT INTO `mix_acticle` VALUES ('33', '24', '30分钟泛型教程', 'www.cnblogs.com', '2016-01-15 10:40:12', '一、泛型入门：我们先来看一个最为常见的泛型类型List<T>的定义(真正的定义比这个要复杂的多，我这里删掉了很多东西)[Serializable]public class List<T> : IList<T>, ICollection<T>, IEnumerable<T>{    public T this[int index] { get; set; }    public void Add(T item);    public void Clear();    public bool Contains(T item);    public int IndexOf(T item);    public bool Remove(T item);    public void Sort();    public T[] ToArray();\n}List后面紧跟着一个<T>表示它操作的是一个未指定的数据类型（T代表着一个未指定的数据类型）可以把T看作一个变量名，T代表着一个类型，在List<T>的源代码中任何地方都能使用TT被用作方法的参数和返回值Add方法接收T类型的参数，ToArray方法返回一个T类型的数组注意：&#12288;&#12288;泛型参数应该以T开头，要么就叫T，要么就叫TKey、TValue之类的；&#12288;&#12288;这跟接口要以I开头是一样的，这是约', '33.html');
INSERT INTO `mix_acticle` VALUES ('34', '24', '30分钟LINQ教程', 'www.cnblogs.com', '2016-01-15 10:51:52', '在说LINQ之前必须先说说几个重要的C#语言特性一：与LINQ有关的语言特性　　1.隐式类型　　　　（1）源起　　　　　　在隐式类型出现之前,　　　　　　我们在声明一个变量的时候,　　　　　　总是要为一个变量指定他的类型　　　　　　甚至在foreach一个集合的时候，　　　　　　也要为遍历的集合的元素，指定变量的类型　　　　　　隐式类型的出现，　　　　　　程序员就不用再做这个工作了。　　　　（2）使用方法　　　　 　　来看下面的代码：　　　　　　　　　　var a = 1; //int a = 1;　　　　　　var b = \"123\";//string b = \"123\"; 　　　　　　var myObj = new MyObj();//MyObj myObj = new MyObj()　　　　　　上面的每行代码，与每行代码后面的注释，起到的作用是完全一样的　　　　　　也就是说，在声明一个变量（并且同时给它赋值）的时候，完全不用指定变量的类型，只要一个var就解决问题了　　　　（3）你担心这样写会降低性能吗？　　　　　　我可以负责任的告诉你，这样写不会影响性能！　　　　　　上面的代码和注释里的代码，编译后产生的IL代码（中间语言代码）是完全一样的　　　　　　（编译器根据变量的值，推导出变量的类型，才产生的IL代码）　　　　　　　　　　（4）这个关键字的好处：　　　　　　你不用在声', '34.html');
