INSERT INTO `mix_acticle` VALUES ('51', '29', '认识HTML5的WebSocket', 'www.cnblogs.com', '2016-04-13 12:58:33', '在HTML5规范中，我最喜欢的Web技术就是正迅速变得流行的WebSocket \nAPI。WebSocket提供了一个受欢迎的技术，以替代我们过去几年一直在用的Ajax技术。这个新的API提供了一个方法，从客户端使用简单的语法\n有效地推动消息到服务器。让我们看一看HTML5的WebSocket \nAPI：它可用于客户端、服务器端。而且有一个优秀的第三方API，名为Socket.IO。一、什么是WebSocket API?WebSocket\n \nAPI是下一代客户端-服务器的异步通信方法。该通信取代了单个的TCP套接字，使用ws或wss协议，可用于任意的客户端和服务器程序。\nWebSocket目前由W3C进行标准化。WebSocket已经受到Firefox 4、Chrome 4、Opera 10.70以及Safari\n 5等浏览器的支持。WebSocket \nAPI最伟大之处在于服务器和客户端可以在给定的时间范围内的任意时刻，相互推送信息。WebSocket并不限于以Ajax(或XHR)方式通信，因为\nAjax技术需要客户端发起请求，而WebSocket服务器和客户端可以彼此相互推送信息；XHR受到域的限制，而WebSocket允许跨域通信。Ajax技术很聪明的一点是没有设计要使用的方式。WebSocket为指定目标创建，用于双向推送消息。二、WebSocket API的用法只专注于', '51.html');
INSERT INTO `mix_acticle` VALUES ('52', '29', '一步一步学WebSocket (一) 初识WebSocket', 'www.cnblogs.com', '2016-04-13 13:10:03', '　　众所周知，Http协议是无状态的，并且是基于Request/Response的方式与服务器进行交互，也就是我们常说的单工模式。但是随着\n互联网的发展，浏览器与服务端进行双向通信需求的增加，长轮询向服务器以获取最新数据并实现推送效果的方式已经越来越不能满足我们。Html5标准的制\n定，也为我们提供了浏览器与服务端的双工通信协议WebSocket。　　WebSocket协议的格式为 \"ws://IP:Port\" 或者“wss://IP:Port\"。其中wss表示进行加密传输的websocket协议。　　WebSocket协议与传统的Socket协议一样，都需要进行“握手”。但是WebSocket的“握手”阶段是通过Http协议进行的，\n“握手”行为通过Request/Response的Header完成，只需要交换很少的数据，便可以创建基于TCP/IP协议的双工通道。下面我们来看\n一下Fiddler截取到的WebSocket握手请求　　　　通过Fiddler我们可以看到，在握手请求时，客户端向服务端发送了一个Get请求，并且在请求的头中增加了这么几个Key　　Origin:http://IP:Port 表示客户端的地址　　Connection:Upgrade / Upgrade:WebSocket 表示本次请求是要进行WebSocket的握手动作　　Sec-WebSocket-Ver', '52.html');
INSERT INTO `mix_acticle` VALUES ('53', '29', '一步一步学WebSocket(二) 使用SuperWebSocket实现自己的服务端', 'www.cnblogs.com', '2016-04-13 13:11:39', '　　上一篇文章，我们了解了客户端如何与服务器创建WebSocket连接。但是一个巴掌拍不响，既然是通信，就必然最少要有两个端。今天我们来看看c#如何用已有的框架实现一个WebSocket服务端。　　在.Net Framework \n4.5及以上版本中，微软为我们集成了WebSocket协议的基本实现。微软提供的WebSocket对象位于\nSystem.Net.WebSocket命名空间下，使用起来挺繁琐的，所以我选择了SuperWebSocket框架来简化开发的难度。　　SuperWebSocket框架可以通过NuGet直接获取并引用到项目中，也可以在http://superwebsocket.codeplex.com/中下载最新的DLL　　我们来看SuperWebSocket如何我们快速搭建一个服务端　　WebSocketServer wsServer = new WebSocketServer();            if (!wsServer.Setup(\"127.0.0.1\", 2012))\n            {                //设置IP 与 端口失败  通常是IP 和端口范围不对引起的 IPV4 IPV6            }            if (!wsServer.Start())\n            {          ', '53.html');
INSERT INTO `mix_acticle` VALUES ('54', '29', '迷你MVVM框架 avalonjs 入门教程', 'www.cnblogs.com', '2016-04-14 10:32:36', 'OniUI组件库学习教程视频教程:             地址1 \n             地址2 \n\n        关于AvalonJs开始的例子扫描视图模型数据模型绑定作用域绑定(ms-controller, ms-important)忽略扫描绑定(ms-skip)模板绑定(ms-include)数据填充(ms-text, ms-html)类名切换(ms-class, ms-hover, ms-active)事件绑定(ms-on，……)显示绑定(ms-visible)插入绑定(ms-if)双工绑定(ms-duplex)样式绑定(ms-css)数据绑定(ms-data)属性绑定(ms-attr)循环绑定(ms-repeat)数组循环绑定(ms-each废弃)对象循环绑定(ms-with废弃)UI绑定(ms-widget)模块间通信及属性监控 $watch，$fire, $unwatch过滤器AMD加载器路由系统AJAX功能扩展在IE6下调试avalon权限控制关于AvalonJSavalon是一个简单易用迷你的MVVM框架，它最早发布于2012.09.15，为解决同一业务逻辑存在各种视图呈现而开发出来的。\n            事实上，这问题其实也可以简单地利用一般的前端模板加jQuery 事件委托 搞定，但随着业务的膨胀，\n            代码就充满了各种选择器', '54.html');

